INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (40011, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 0, 2, 24001, 1, 125801, 1, "リリ", 321, 1);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (40011, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 0, 2, 24001, 1, 126001, 1, "クリア", 322, 2);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (40011, "んーと。\nこれ、あげる。\nはい", 0, 2, 24001, 1, 126101, 1, "プレシア", 323, 3);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (40011, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 0, 2, 24001, 2, 125801, 1, "リリ", 324, 4);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (40011, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, 2, 24001, 2, 126001, 1, "クリア", 325, 5);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (40011, "お兄。\nきてくれて、うれしい", 0, 2, 24001, 2, 126101, 1, "プレシア", 326, 6);
